import React from "react";
import Banner from "./Banner";
import TrendingMovies from "./TrendingMovies";

export default function Home({ watchList, handleAddToWatchList }) {
  return (
    <>
      <Banner />
      <TrendingMovies watchList={watchList} />
    </>
  );
}
